    // 模型初始动画生成
    const staticAnimation = createStaticAnimation(a)

    function createStaticAnimation (aa) {
      function handleAnimationData(a) {
        const b = a.shift()
        const c = a.pop()
        const times = a.map(item => item.time)
        const values = a.reduce((acc, item) => {
          b.frame_descriptor.forEach(bone => {
            const data = item.data
            const index = bone.offset
            if (bone.ch === 'pos') {
              acc[bone.node + '-pos'] ||= []
              acc[bone.node + '-pos'].push(...data.slice(index, index + 3))
            } else {
              acc[bone.node] ||= []
              acc[bone.node].push(...data.slice(index, index + 4))
            }
          })
          return acc
        }, {})
        return { times, values }
      }
      function createAnimation({ times, values }, name = 'test') { // 生成动画
        const tracks = []
        for (const key in values) {
          if (key.includes('-pos')) {
            tracks.push(new THREE.KeyframeTrack(key.split(':').join('').slice(0, -4) + '.position', new Float32Array(times), new Float32Array(values[key])))
          } else {
            tracks.push(new THREE.KeyframeTrack(key.split(':').join('') + '.quaternion', new Float32Array(times), new Float32Array(values[key])))
          }
        }
        return new THREE.AnimationClip(name, times[times.length - 1], tracks)
      }
      return createAnimation(handleAnimationData(aa))
    }

        mesh.rotation.x = - Math.PI / 2
        mesh.translateX(model.x)
        mesh.translateZ(model.y + 7)

        mesh.receiveShadow = true
        scene.add(mesh)
      }

        const geometry = new THREE.SphereGeometry(500)
        geometry.scale(- 1, 1, 1)

        mesh.receiveShadow = true
        scene.add(mesh)
      }

      function addBoxShadow() {
        const skyBox = new THREE.Mesh(new THREE.BoxGeometry(1000, 1000, 1000), new THREE.ShadowMaterial())
        skyBox.receiveShadow = true
        scene.add(skyBox)
      }

        const loader = new FBXLoader()
        loader.load(url, object => {

          console.log(object)

          const action = mixer.clipAction(staticAnimation)
          action.play() // 初始动画运行

          // object.children.splice(1,1)

            }

                context = canvas.getContext('2d')
                canvas.height = tileWidth
                canvas.width = tileWidth
                context.drawImage(image, tileWidth * i, 0, tileWidth, tileWidth, 0, 0, tileWidth, tileWidth)
                textures[i].image = canvas
                textures[i].needsUpdate = true
              }
            })
          return textures
        }
      }

      function init() {

        const container = document.getElementById('container')

        renderer = new THREE.WebGLRenderer()
        renderer.setPixelRatio(window.devicePixelRatio)
        renderer.setSize(window.innerWidth, window.innerHeight)
        container.appendChild(renderer.domElement)

        renderer.shadowMap.enabled = true
        renderer.shadowMap.type = THREE.PCFSoftShadowMap // default 

        scene = new THREE.Scene()


        camera = new THREE.PerspectiveCamera(90, window.innerWidth / window.innerHeight, 0.01, 4000)
        camera.position.set(0, 0, 0.01)

        controls = new OrbitControls(camera, renderer.domElement)
        if (cameraControls) {
          controls.enableZoom = false
          controls.enablePan = false
          controls.enableDamping = true
          controls.rotateSpeed = - 0.25 // 摄像头移动限制
        }

        initLight()
        loadModel()

        window.addEventListener('resize', onWindowResize)

      }

      function onWindowResize() {
        camera.aspect = window.innerWidth / window.innerHeight
        camera.updateProjectionMatrix()
        renderer.setSize(window.innerWidth, window.innerHeight)
      }

      function animate() {
        requestAnimationFrame(animate)
        const delta = clock.getDelta()
        mixer && mixer.update(delta)
        controls.update() // required when damping is enabled
        renderer.render(scene, camera)
      }
    
      /**
       * 八象限法---根据全景二维坐标换算球面坐标
       * @param
       * panoramaX: 二维全景x
       * panoramaY: 二维全景y
       * panoramaW: 全景图宽度w
       * panoramaH: 全景图高度h
       * R: 球体半径
       */
      function coordinateTransformation(panoramaX, panoramaY, panoramaW = 3000, panoramaH = 1500, R = 500) {
        if (!panoramaX || !panoramaY) {
            return false
        }
        // 默认第一象限(0,0)=>(0,1,0)
        let quadrantNum = 0
        // 球坐标法线
        let normal = { x: 1, y: 1, z: 1 }
        // 球坐标
        let sphereCoordinate = { x: 0, y: 0, z: 0 }
        // 全景图切分数,按4:2:2的比例,至少8个象限
        const QUARTER_W_SEGMENT = 4
        const HALF_H_SEGMENT = 2
        // 象限单位
        const QUARTER_W = Math.floor(panoramaW / QUARTER_W_SEGMENT)
        const HALF_H = Math.floor(panoramaH / HALF_H_SEGMENT)
        // 象限外偏移,用于确定坐标象限
        const QUADRANT_X = Math.floor(panoramaX / QUARTER_W)
        const QUADRANT_Y = Math.floor(panoramaY / HALF_H)
        // 象限内偏移,用于换算球体坐标
        const OFFSET_X_2D = Math.floor(panoramaX % QUARTER_W)
        const OFFSET_Y_2D = Math.floor(panoramaY % HALF_H)
        // 在南半球
        if (QUADRANT_Y) {
            quadrantNum += QUARTER_W_SEGMENT
            normal.y = -1
        }
        // 确定象限
        if (QUADRANT_X) {
            quadrantNum += QUADRANT_X
        }
        // 在左半球
        if (quadrantNum % QUARTER_W_SEGMENT < 2) {
            normal.x = -1
        }
        // 在前半球
        if (quadrantNum % QUARTER_W_SEGMENT < 3 && quadrantNum % QUARTER_W_SEGMENT > 0) {
            normal.z = -1
        }
        console.log('球体法线normal', normal);

        // 对Z轴影响的权重
        let POWER_Z = ""
        // 南北半球坐标转换,通过normal.y消除Y轴偏移带来的误差
        if (normal.y > 0) {
            //北半球右旋
            sphereCoordinate.y = (HALF_H - OFFSET_Y_2D) * 1.25 / HALF_H * normal.y
            POWER_Z = OFFSET_Y_2D / OFFSET_X_2D < 1 ? "Y" : "X"
        } else {
            //南半球左旋
            sphereCoordinate.y = (OFFSET_Y_2D / HALF_H) * 1.25 * normal.y
            POWER_Z = OFFSET_Y_2D / OFFSET_X_2D > 1 ? "Y" : "X"
        }

        //没有了Y轴,简化为四象限
        switch (quadrantNum % QUARTER_W_SEGMENT) {
            case 0: {
                sphereCoordinate.x = OFFSET_X_2D / QUARTER_W * normal.x
                if (POWER_Z === "X") {
                    sphereCoordinate.z = (QUARTER_W - OFFSET_X_2D) / QUARTER_W * normal.z
                } else if (POWER_Z === "Y") {
                    if (normal.y > 0) {
                        sphereCoordinate.z = OFFSET_Y_2D / HALF_H * normal.z
                    } else {
                        sphereCoordinate.z = (HALF_H - OFFSET_Y_2D) / HALF_H * normal.z
                    }
                }
                break
            }
            case 1: {
                sphereCoordinate.x = (QUARTER_W - OFFSET_X_2D) / QUARTER_W * normal.x
                if (POWER_Z === "X") {
                    sphereCoordinate.z = (OFFSET_X_2D) / QUARTER_W * normal.z
                } else if (POWER_Z === "Y") {
                    if (normal.y > 0) {
                        sphereCoordinate.z = OFFSET_Y_2D / HALF_H * normal.z
                    } else {
                        sphereCoordinate.z = (HALF_H - OFFSET_Y_2D) / HALF_H * normal.z
                    }
                }
                break
            }
            case 2: {
                sphereCoordinate.x = OFFSET_X_2D / QUARTER_W * normal.x
                if (POWER_Z === "X") {
                    sphereCoordinate.z = (QUARTER_W - OFFSET_X_2D) / QUARTER_W * normal.z
                } else if (POWER_Z === "Y") {
                    if (normal.y > 0) {
                        sphereCoordinate.z = OFFSET_Y_2D / HALF_H * normal.z
                    } else {
                        sphereCoordinate.z = (HALF_H - OFFSET_Y_2D) / HALF_H * normal.z
                    }
                }
                break
            }
            case 3: {
                sphereCoordinate.x = (QUARTER_W - OFFSET_X_2D) / QUARTER_W * normal.x
                if (POWER_Z === "X") {
                    sphereCoordinate.z = (OFFSET_X_2D) / QUARTER_W * normal.z
                } else if (POWER_Z === "Y") {
                    if (normal.y > 0) {
                        sphereCoordinate.z = OFFSET_Y_2D / HALF_H * normal.z
                    } else {
                        sphereCoordinate.z = (HALF_H - OFFSET_Y_2D) / HALF_H * normal.z
                    }
                }
                break
            }
        }
        sphereCoordinate = {
            x: Math.ceil(sphereCoordinate.x * R),
            y: Math.ceil(sphereCoordinate.y * R),
            z: Math.ceil(sphereCoordinate.z * R)
        }
        console.log('球体坐标sphereCoordinate', sphereCoordinate);
        return sphereCoordinate
      }
    
    }()

  </script>
